              "names": "Zero Two",
              "img_url": "https://s4.anilist.co/file/anilistcdn/character/large/b124381-pkTKi6HHNuVR.png",
              "claims": "#3",
              "anime": "Darling In The Franxx"
            }
          }
        }

        //fetch JSON
        if (keyword != '') {
          let output = Object.values(data.waifuID).find(waifu => waifu.names.includes(keyword.toLowerCase()))
          if (output != undefined) {
            showResults.innerHTML = JSON.stringify(output)
